import { Outlet, Form } from "react-router-dom";

const Root = () => {
  return (
    <div style={{
        width: '100%',
        height: 80,
        background: 'gray',
        flexDirection: 'row',
        display: 'flex'
    }}>
        <Form action="/" style={{width: '20%', height: '100%', background: 'blue'}}>
        <button>Home</button>
      </Form>
      <Form action="/Hotels">
        <button>Hotels</button>
      </Form>
      <Form action="/QA">
        <button type="submit">QA</button>
      </Form>
      <Form action="/Help">
        <button type="submit">HELP</button>
      </Form>
      <Form action="/Map">
        <button type="submit">Map</button>
      </Form>
      <Outlet/>
    </div>
)
};

export default Root;
